"use strict";(globalThis.webpackChunkt_ruby_docs=globalThis.webpackChunkt_ruby_docs||[]).push([[8413],{1592:n=>{n.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"welcome","metadata":{"permalink":"/ko/blog/welcome","editUrl":"https://github.com/type-ruby/t-ruby.github.io/tree/main/blog/2025-12-24-welcome/index.md","source":"@site/i18n/ko/docusaurus-plugin-content-blog/2025-12-24-welcome/index.md","title":"T-Ruby \ube14\ub85c\uadf8\uc5d0 \uc624\uc2e0 \uac83\uc744 \ud658\uc601\ud569\ub2c8\ub2e4","description":"\uacf5\uc2dd T-Ruby \ube14\ub85c\uadf8\uc5d0 \uc624\uc2e0 \uac83\uc744 \ud658\uc601\ud569\ub2c8\ub2e4! \uc774\uacf3\uc5d0\uc11c \ud29c\ud1a0\ub9ac\uc5bc, \uae30\uc220 \uc2ec\uce35 \ubd84\uc11d, \ud0c0\uc785 \uc548\uc804 Ruby \uac1c\ubc1c\uc5d0 \ub300\ud55c \uc778\uc0ac\uc774\ud2b8\ub97c \uacf5\uc720\ud560 \uc608\uc815\uc785\ub2c8\ub2e4.","date":"2025-12-24T00:00:00.000Z","tags":[{"inline":true,"label":"announcement","permalink":"/ko/blog/tags/announcement"}],"readingTime":0.66,"hasTruncateMarker":true,"authors":[{"name":"Yonghyun Kim","url":"https://github.com/yhk1038","imageURL":"https://github.com/yhk1038.png","key":"yhk1038","page":null}],"frontMatter":{"slug":"welcome","title":"T-Ruby \ube14\ub85c\uadf8\uc5d0 \uc624\uc2e0 \uac83\uc744 \ud658\uc601\ud569\ub2c8\ub2e4","authors":["yhk1038"],"tags":["announcement"]},"unlisted":false},"content":"\uacf5\uc2dd T-Ruby \ube14\ub85c\uadf8\uc5d0 \uc624\uc2e0 \uac83\uc744 \ud658\uc601\ud569\ub2c8\ub2e4! \uc774\uacf3\uc5d0\uc11c \ud29c\ud1a0\ub9ac\uc5bc, \uae30\uc220 \uc2ec\uce35 \ubd84\uc11d, \ud0c0\uc785 \uc548\uc804 Ruby \uac1c\ubc1c\uc5d0 \ub300\ud55c \uc778\uc0ac\uc774\ud2b8\ub97c \uacf5\uc720\ud560 \uc608\uc815\uc785\ub2c8\ub2e4.\\n\\n\x3c!-- truncate --\x3e\\n\\n## \uc774 \ube14\ub85c\uadf8\uc5d0\uc11c \ub2e4\ub8e8\ub294 \ub0b4\uc6a9\\n\\n\uc774 \ube14\ub85c\uadf8\ub294 \ub2e4\uc74c\uacfc \uac19\uc740 \ucf58\ud150\uce20\ub97c \uc81c\uacf5\ud569\ub2c8\ub2e4:\\n\\n### \ud29c\ud1a0\ub9ac\uc5bc\\n\\nT-Ruby\ub97c \ucd5c\ub300\ud55c \ud65c\uc6a9\ud560 \uc218 \uc788\ub3c4\ub85d \ub3c4\uc640\uc8fc\ub294 \ub2e8\uacc4\ubcc4 \uac00\uc774\ub4dc. \uae30\ubcf8 \ud0c0\uc785 \uc5b4\ub178\ud14c\uc774\uc158\ubd80\ud130 \uace0\uae09 \uc81c\ub124\ub9ad \ud328\ud134\uae4c\uc9c0 \ubaa8\ub450 \ub2e4\ub8f9\ub2c8\ub2e4.\\n\\n### \uae30\uc220 \uc2ec\uce35 \ubd84\uc11d\\n\\nT-Ruby \ud0c0\uc785 \uc2dc\uc2a4\ud15c\uc758 \ub0b4\ubd80\ub97c \ud0d0\uad6c\ud569\ub2c8\ub2e4. \ud0c0\uc785 \ucd94\ub860\uc758 \uc791\ub3d9 \ubc29\uc2dd, RBS \ud30c\uc77c \uc0dd\uc131 \ubc29\ubc95, \ud504\ub85c\uc81d\ud2b8\uc758 \uc124\uacc4 \uacb0\uc815\uc5d0 \ub300\ud574 \uc54c\uc544\ubd05\ub2c8\ub2e4.\\n\\n### \ubca0\uc2a4\ud2b8 \ud504\ub799\ud2f0\uc2a4\\n\\n\ud0c0\uc785 \uc548\uc804 Ruby \ucf54\ub4dc\ub97c \uc791\uc131\ud558\uae30 \uc704\ud55c \uc2e4\uc81c \ud328\ud134\uacfc \uc0ac\ub840. \uc2e4\uc81c \ud504\ub85c\uc81d\ud2b8\uc758 \uc608\uc81c\ub97c \uacf5\uc720\ud558\uace0 \ud53c\ud574\uc57c \ud560 \uc77c\ubc18\uc801\uc778 \ud568\uc815\uc5d0 \ub300\ud574 \ub17c\uc758\ud569\ub2c8\ub2e4.\\n\\n### \ucee4\ubba4\ub2c8\ud2f0 \ud558\uc774\ub77c\uc774\ud2b8\\n\\nT-Ruby \ucee4\ubba4\ub2c8\ud2f0\uc758 \ud765\ubbf8\ub85c\uc6b4 \ud504\ub85c\uc81d\ud2b8\uc640 \uae30\uc5ec\ub97c \uc18c\uac1c\ud569\ub2c8\ub2e4.\\n\\n## \ucd5c\uc2e0 \uc18c\uc2dd \ubc1b\uae30\\n\\n\ub9b4\ub9ac\uc2a4 \uacf5\uc9c0 \ubc0f \ud504\ub85c\uc81d\ud2b8 \uc5c5\ub370\uc774\ud2b8\ub294 [\ub274\uc2a4](/news) \uc139\uc158\uc744 \ud655\uc778\ud558\uc138\uc694. \uc2ec\uce35 \ucf58\ud150\uce20\ub97c \uc704\ud574 \uc774 \ube14\ub85c\uadf8\ub97c \ubd81\ub9c8\ud06c\ud558\uace0 \uc815\uae30\uc801\uc73c\ub85c \ubc29\ubb38\ud574 \uc8fc\uc138\uc694.\\n\\n\uc774 \uc5ec\uc815\uc744 \ud568\uaed8\ud558\uac8c \ub418\uc5b4 \uae30\uc069\ub2c8\ub2e4. \uc990\uac70\uc6b4 \ud0c0\uc774\ud551 \ub418\uc138\uc694!"}]}}')}}]);